  false,\n\t\"url\": null,\n\t\"notes\": \"NCEI Accession 0144338 includes Surface
  underway data collected from HEALY in the Arctic Ocean, Beaufort Sea, Bering Sea,
  Coastal Waters of SE Alaska and North Pacific Ocean from 2012-08-01 to 2012-10-24.
  These data include BAROMETRIC PRESSURE, Partial pressure (or fugacity) of carbon
  dioxide - water, SALINITY and SEA SURFACE TEMPERATURE. The instruments used to collect
  these data include Carbon dioxide (CO2) gas analyzer and Shower head chamber equilibrator
  for autonomous carbon dioxide (CO2) measurement.nnThese data were collected by Taro
  Takahashi and Stew Sutherland of Columbia University; Lamont-Doherty Earth Observatory
  and Colm Sweeney of University of Colorado at Boulder; Cooperative Institute for
  Research In Environmental Sciences as part of the VOS_Healy_Lines_2012 data set.
  CDIAC associated the following cruise ID(s) with this data set: 32HQ20120801nnThe
  Global Volunteer Observing Ship (VOS) Program is coordinated by the UNESCO International
  Ocean Carbon Coordination Project (IOCCP). International groups from 14 countries
  have been outfitting research ships and commercial vessels with automated CO2 sampling
  equipment to analyze the carbon exchange between the ocean and atmosphere.\",\n\t\"owner_org\":
